					"selector": ".product-list-item__final-price"
				}
			}
		]
	},
	"/checkout/place-order/": {
		"orders": [
			{
				"cartTotal": {
					"selector": "div.sds_tx_right.orderSummary__totalText"
				}
			}
		],
		"emptyCartSelector": "#popupError__message",
		"products": [
			{
				"row": {
					"selector": ".shoppingBag__item"
				},
				"name": {
					"selector": ".shoppingBag__itemTitle"
				},
				"qty": {
					"selector": "#shoppingBag__itemDesc_size + div",
					"useType": false
				},
				"price": {
					"selector": ".shoppingBag__itemPrice"
				}
			}
		]
	},
	"/my-account/order-history/": {
		"orders": [
			{
				"row": {
					"selector": ".order-card-container"
				},
				"orderID": {
					"selector": ".order-Number",
					"manipulator": "splitGetByIndex:#:1"
				},
				"orderDate": {
					"selector": ".sds_g-17-24",
					"manipulator": "splitGetByIndexLast:on ::formatDate:MMM DD, YYYY"
				}
			}
		],
		"products": [
			{
				"row": {
					"selector": ".order-history-carousel-item"
				},
				"name": {
					"selector": ".product-item-image",
					"useType": "true"
				},
				"qty": {
					"selector": "div.carousel-item-text",
					"useDefault": 1
				}
			}
		]
	},
	"/my-account/order-details/*": {
		"orders": [
			{
				"orderDate": {
					"selector": ".order-summary-body-package-count .sds_grid-root:nth-child(1) .sds_g-15-24",
					"manipulator": "splitGetByIndex:(:0::formatDate:MMMM DD, YYYY"
				},
				"orderID": {
					"selector": ".order-summary-body-package-count .sds_grid-root:nth-child(2) .sds_g-15-24"
				},
				"cartTotal": {
					"selector": ".order-summary-body-package-count .sds_grid-root:nth-child(3) .sds_g-15-24",
					"manipulator": "splitGetByIndex:(:0"
				}
			}
		],
		"products": [
			{
				"row": {
					"selector": ".order-summary-top-card.no-margin .card-container"
				},
				"name": {
					"selector": "[id='product-description-header-id']"
				},
				"link": {
					"selector": "[id='product-description-header-id'] a",
					"useType": true
				},
				"price": {
					"selector": ".sds-cb_body-a:nth-child(3)",
					"manipulator": "splitGetByIndex:Price:1"
				},
				"qty": {
					"selector": ".sds_g-2-3",
					"manipulator": "splitGetByIndex:Qty:1"
				},
				"productID": {
					"selector": ".sds-cb_label-c",
					"manipulator": "splitGetByIndex:#:1"
				}
			}
		]
	}
}

